const allWords = Object.keys(allWeights);

function randomChoice(list) {
    if (list.length > 0) {
        return list[Math.floor(Math.random() * list.length)];
    }
}

function weightedChoice(v, w) {
    for (let i = 0; i < w.length; i++) {
        w[i] += w[i - 1] || 0;
    }
    let n = Math.random() * w[w.length - 1];
    for (let i = 0; i < w.length; i++) {
        if (n < w[i]) {
            return v[i];
        }
    }
    return v[v.length - 1];
}

function generateNextWord(w) {
    if (!w) {
        return randomChoice(allWords);
    }
    let weights = allWeights[w];
    let keys = Object.keys(weights);
    let values = Object.values(weights);
    if (keys.length === 0 || values.length === 0) {
        return generateNextWord("");
    }
    let nextWord = weightedChoice(keys, values);
    return nextWord;
}

function generateManyWords(n) {
    let words = [];
    while (words.length < n) {
        let lastWord = "";
        if (words.length > 0) {
            lastWord = words[words.length - 1];
        }
        words.push(generateNextWord(lastWord));
    }
    return words.join(" ");
}
